import './App.css';
import React from 'react';
import Navbar from './Navbar';
import Home from './Home';
function App() {
  return (
    <div className="personal_portfolio" style={{ display: 'flex', flexDirection: 'column' }}>
      <Navbar />
      <Home />
    </div>
  );
}

export default App;
